import {React, useState} from 'react'
import './Header.css'
import Logo from '../../shared/photo/logo.jpg'
import { IoIosMenu } from "react-icons/io";
// import { NavLink } from 'react-router-dom';
import { FiMapPin } from "react-icons/fi";
import { TfiWorld } from "react-icons/tfi";
import { FaQuestion } from "react-icons/fa";

const Header = () => {
  const [isMenu, setIsMenu] = useState(false);

  const toggleIsMenu = () => {
    setIsMenu(prevState => !prevState);
  }

  return (
    <div className='header-component'>
        <div className="header_content">
          <nav className="nav">
                <li className='logo' to='/'><img src={Logo} alt="logo working work"/></li>
                
                <div className="menu-icon" onClick={toggleIsMenu}>
                  <IoIosMenu size={30} color='white'/>
                </div>

                <ul className={`nav_list ${isMenu ? 'active' : ''}`}>
                    <li to='/CreateExercise'>Создать задание</li>
                    <li to='/FindExercise'>Найти задание</li>
                    <li to='/Login'>Войти</li>
                    <li><FiMapPin/></li>
                    <li><TfiWorld/></li>
                    <li><FaQuestion/></li>
                </ul>
            </nav>
        
        </div>
        
    </div>
  )
}

export default Header
